export const initialState = {
  randomWord: ''
};

export const reducer = (state = initialState, action) => {
    switch (action.type) {
        case "SET_RANDOM_WORD":
          return {
            ...state,
            randomWord: action.payload 
          };

        default:
            return state;
    }
  };

export const setRandomWord = word => {
  return {
    type: "SET_RANDOM_WORD",
    payload: word
  };
};
